import {useState} from 'react';
import saveIcon from './assets/save.png';
import './css/Note.css';

function Modal({open}){
    if (!open) {
        return null;
    }
    return (
        <div className='overlay'>
            <div className='modal'>
                <form>
                    <input type="text" id="fname" name="fname"/>
                    <label>Text: </label>
                    <input type="text" id="lname" name="lname"/>
                </form>
            </div>
        </div>
    );
}

export default Modal;
